import React from "react";
import Login from "./Login";
import Menu from "./Menu";
import LeftMenu from "./LeftMenu";
import { Container, Row, Col } from "reactstrap";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Menu></Menu>
        </Row>
        <Row>
          <Col xs="3"><LeftMenu></LeftMenu></Col>
          <Col xs="9"></Col>
          <Login></Login>
        </Row>
      </Container>
    </div>
  );
}

export default App;
